user_like_id = 0
15.times do
  num = Faker::Number.within(range: 4..8)
  likes = []
  while num > 0 do
    song_like_id = Faker::Number.within(range: 0..49)
    unless likes.include?(song_like_id)
      like = Like.create({ user_id: user_like_id, song_id: song_like_id })
      likes.push(song_like_id)
      num -= 1
    end  
  end
  user_like_id += 1
end

user_follower_id = 0
15.times do
  num = Faker::Number.within(range: 5..12)
  follows = []
  while num > 0 do
    user_followee_id = Faker::Number.within(range: 0..49)
    unless follows.include?(user_followee_id)
      follow = Follow.create({ user_id: user_followee_id, follower_id: user_follower_id })
      follows.push(user_followee_id)
      num -= 1
    end  
  end
  user_follower_id += 1
end





